  SIGNAL Delay8_out1                      : std_logic_vector(15 DOWNTO 0);  -- sfix16_En15
  SIGNAL Vector_Concatenate2_out1         : vector_of_std_logic_vector16(0 TO 1);  -- sfix16_En15 [2]
  SIGNAL Delay6_out1                      : vector_of_std_logic_vector16(0 TO 1);  -- sfix16_En15 [2]
