  SIGNAL gs2_i_out1                       : std_logic_vector(15 DOWNTO 0);  -- sfix16_En15
  SIGNAL Delay2_reg                       : vector_of_std_logic_vector16(0 TO 1);  -- sfix16 [2]
  SIGNAL Delay2_out1                      : std_logic_vector(15 DOWNTO 0);  -- sfix16_En15
  SIGNAL gs2_q_k                          : unsigned(11 DOWNTO 0);  -- ufix12
  SIGNAL gs2_q_out1                       : std_logic_vector(15 DOWNTO 0);  -- sfix16_En15
  SIGNAL Delay3_reg                       : vector_of_std_logic_vector16(0 TO 1);  -- sfix16 [2]
  SIGNAL Delay3_out1                      : std_logic_vector(15 DOWNTO 0);  -- sfix16_En15
  SIGNAL Vector_Concatenate1_out1         : vector_of_std_logic_vector16(0 TO 1);  -- sfix16_En15 [2]
  SIGNAL Delay11_out1                     : vector_of_std_logic_vector16(0 TO 1);  -- sfix16_En15 [2]

BEGIN
  gs_addr_unsigned <= unsigned(gs_addr);

