      -- END IF;
    -- END IF;
  -- END PROCESS Delay4_process;


  reduced_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay4_out1_1 <= to_unsigned(16#000#, 12);
      ELSIF enb = '1' THEN
        -- Delay4_out1_1 <= Delay4_out1;
        Delay4_out1_1 <= gs_addr_unsigned;
      END IF;
    END IF;
  END PROCESS reduced_process;


  
  gs1_i_k <= to_unsigned(16#000#, 12) WHEN Delay4_out1_1 = to_unsigned(16#000#, 12) ELSE
      to_unsigned(16#FFF#, 12) WHEN Delay4_out1_1 = to_unsigned(16#FFF#, 12) ELSE
      Delay4_out1_1;
  gs1_i_out1 <= lut_gs1(to_integer(gs1_i_k));

  Delay5_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay5_reg <= (OTHERS => x"0000");
      ELSIF enb = '1' THEN
        Delay5_reg(0) <= gs1_i_out1;
        Delay5_reg(1) <= Delay5_reg(0);
      END IF;
    END IF;
  END PROCESS Delay5_process;

  Delay5_out1 <= Delay5_reg(0);

  
  gs1_q_k <= to_unsigned(16#000#, 12) WHEN Delay4_out1_1 = to_unsigned(16#000#, 12) ELSE
      to_unsigned(16#FFF#, 12) WHEN Delay4_out1_1 = to_unsigned(16#FFF#, 12) ELSE
      Delay4_out1_1;
  gs1_q_out1 <= gs1_i_out1; --gs1_i_table_data_2(to_integer(gs1_q_k));

  Delay8_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay8_reg <= (OTHERS => x"0000");
      ELSIF enb = '1' THEN
        Delay8_reg(0) <= gs1_q_out1;
        Delay8_reg(1) <= Delay8_reg(0);
      END IF;
    END IF;
  END PROCESS Delay8_process;

  Delay8_out1 <= Delay8_reg(0);

  Vector_Concatenate2_out1(0) <= Delay5_out1;
  Vector_Concatenate2_out1(1) <= Delay8_out1;

  Delay6_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay6_out1 <= (OTHERS => x"0000");
      ELSIF enb = '1' THEN
        Delay6_out1 <= Vector_Concatenate2_out1;
      END IF;
    END IF;
  END PROCESS Delay6_process;

  gs1 <= Vector_Concatenate2_out1;

  
  gs2_i_k <= to_unsigned(16#000#, 12) WHEN Delay4_out1_1 = to_unsigned(16#000#, 12) ELSE
      to_unsigned(16#FFF#, 12) WHEN Delay4_out1_1 = to_unsigned(16#FFF#, 12) ELSE
      Delay4_out1_1;
  gs2_i_out1 <= lut_gs2(to_integer(gs2_i_k));

  Delay2_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay2_reg <= (OTHERS => x"0000");
      ELSIF enb = '1' THEN
        Delay2_reg(0) <= gs2_i_out1;
        Delay2_reg(1) <= Delay2_reg(0);
      END IF;
    END IF;
  END PROCESS Delay2_process;

  Delay2_out1 <= Delay2_reg(0);

  
  gs2_q_k <= to_unsigned(16#000#, 12) WHEN Delay4_out1_1 = to_unsigned(16#000#, 12) ELSE
      to_unsigned(16#FFF#, 12) WHEN Delay4_out1_1 = to_unsigned(16#FFF#, 12) ELSE
      Delay4_out1_1;
  gs2_q_out1 <= gs2_i_out1; --gs2_i_table_data_2(to_integer(gs2_q_k));

  Delay3_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay3_reg <= (OTHERS => x"0000");
      ELSIF enb = '1' THEN
        Delay3_reg(0) <= gs2_q_out1;
        Delay3_reg(1) <= Delay3_reg(0);
      END IF;
    END IF;
  END PROCESS Delay3_process;

  Delay3_out1 <= Delay3_reg(0);

  Vector_Concatenate1_out1(0) <= Delay2_out1;
  Vector_Concatenate1_out1(1) <= Delay3_out1;

  Delay11_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset = '1' THEN
        Delay11_out1 <= (OTHERS => x"0000");
      ELSIF enb = '1' THEN
        Delay11_out1 <= Vector_Concatenate1_out1;
      END IF;
    END IF;
  END PROCESS Delay11_process;

  gs2 <= Vector_Concatenate1_out1;

END rtl;

